export const generateID = () => {
  const symbols =
    'AaBbCcDdEeFfGgHhIiJjKkLlMmNnOoPpQqRrSsTtUuVvWwXxYyZz0123456789';
  const limit = symbols.length;
  let id = '';
  for (let i = 0; i < 12; i++) {
    const idx = Math.floor(Math.random() * limit);
    id += symbols[idx];
  }
  return id;
};
